details_of_achievement:
AIMS AND OBJECTIVES:
*Protect the dignity, rights and security of people;
*Organize research, Education and Training programs, Seminars, Conferences, Workshops, Camps;
*News information documentation, research, continuing education.
*Bring out publications and help publishing books, journals etc, obtaining ISBN, ISSN, copyright regn. Etc.
*Schools / institutions for basic, primary, adult, cultural, ICT and technical.
*Advanced education, studies and research in cultural, political, religious, scientific and ICT.
Helping needy students in study, promoting and encouraging child education (focus poor and girl child);
*Promoting training research and cooperation to cottage and home industries;
* Library and Reading rooms;
* Indological studies; preserve and restore of ancient and historical cultures;
* Cultural activities, training, research (folk art, music, dance, drama);
* Sports and Games, travelling, trekking etc.;
* Medical, healthcare, prevention of pollution;
* Activism against women, children abuse and domestic violence;
* Helping in marriage, handle social problems;
* Cooperating government authorities for speedy dispute settlement.

ACHIEVEMENTS;
*Various programs and seminars, conferences etc.;
* Literature books published;
* Lifetime achievement awarding for first time for Bengali literature;
* organised various training programs and workshops;
* Made documentaries;
* Various awareness programs etc.
